		<div>
			<Container>
				<Bounce>
					<h1>About</h1>
				</Bounce>
                <Bounce>

				<p>
					This is my project to showcase News and to provide some level of entertainment.The Daily picture button is to provide you with a picture that day related to astronomy 
				</p>
                </Bounce>
			</Container>
		</div>
	);
};

export default About;
